import React from "react";
import { createRoot } from 'react-dom/client';

const container = document.getElementById('root');
const root = createRoot(container);
const img = "https://picsum.photos/200";

root.render(
  <div>
    <h1 className="heading" contentEditable="true" spellCheck="false" suppressContentEditableWarning="true">
      My Favourite Foods
    </h1>
    <div>
      <img src={img + "?grayscale"} alt="random-img" />
      <img className="food-img" src="data:image/jpeg;base64," alt="banana" />
      <img className="food-img" src="data:image/jpeg;base64," alt="Apple" />
      <img className="food-img" src="data:image/jpeg;base64," alt="Orange" />
    </div>
  </div>
);